import React from 'react';

class Signup extends React.Component{

    constructor(props){
        super(props);
        this.state={
            name:"",
            emailId:"",
            password:"",
        };
        this.onChange=this.onChange.bind(this);
        
    }
    onChange(event){
        console.log(event.target.value);
         //this.setState({name:event.target.value});
        // this.setState({emailId:event.target.value});
         //this.setState({password:event.target.value});
    }

    handleClick(event){
       console.log(this.state.name);
     //   var mydb=require("../../MydbConnect");
   //     mydb.add(this.state.name,this.state.emailId,this.state.password);


    }

    render(){
        return (
                <div className="project">
                  <div className="container">
                        <div className="row">
                            <div className="col-md-8 m-auto">
                                <h5 className="display-4 text-center">User Sign Up Form</h5>
                                <hr></hr>
                                <form>
                                        <div className="form-group">
                                             <input type="text" name="name" value={this.state.name}
                                             className="form-control form-control-lg" 
                                             placeholder="Name"></input>

                                        </div>
                                        <div className="form-group">
                                             <input type="text" value={this.state.emailId}  name="emailId" className="form-control form-control-lg" placeholder="Email Id"></input>
                                        </div>
                                        
                                        <div className="form-group">
                                             <input type="text" value={this.state.password}  name="password" className="form-control form-control-lg" placeholder="Password"></input>
                                        </div>
                                        <input type="button" onClick={(event)=>this.handleClick(event.state)} className="btn btn-primary btn-black mt-4" name="signup" value="Sign Up" />
                                       
                                </form>
                            </div>
                        </div>
                  </div>
                </div>
            

        );
    }
}

export default Signup;
